import React from 'react'

const FoodLog = () => {
  return (
    <main className='FoodLog'>
        <h2>Food Log</h2>
        <p style={{ marginTop: '1rem' }}>
          This is FoodLog page.<br/><br/>
        </p>
        <h1>Working in progress</h1>
    </main>
  )
}

export default FoodLog
